import React from 'react';
import { List, Button } from './styles';

export interface IUserNavProps {
  width?: string;
  className?: string;
}

const UserNav: React.FC<IUserNavProps> = ({ width, className }) => {
  return (
    <List className={className} width={width}>
      <li key='1'>
        <Button>
          <p>Войти</p>
        </Button>
      </li>
      <li key='2'>
        <Button>
          <p>Корзина</p>
        </Button>
      </li>
    </List>
  )
};

export default UserNav;
